import React from 'react';
import Tabs from 'react-bootstrap/Tabs';
/**
 * Header component
 */
export default class Header extends  React.Component {
    render() {
        return <header className="App-header">
            <Tabs defaultActiveKey="home">

            </Tabs>
        </header>
    }
};
